import avatar from '../images/Avatar.png'
import plus from '../images/plus.svg'

function handleEditAvatarClick() {
  document.querySelector('.popup_update-avatar').classList.add('popup_opened')
  console.log('Не дави на меня!');
}

function handleEditProfileClick() {
  document.querySelector('.profile__edit-button').classList.add('popup_opened')

  console.log('Не дави на меня!');
}

function handleAddPlaceClick() {
  document.querySelector('.profile__btn').classList.add('popup_opened')
  console.log('Не дави на меня!');
}


function Main() {
  return (
    <main>
    <section class="profile container">
        <a href="#" class="profile__container" target="_self"
                  onClick={handleEditAvatarClick}
                  >        
          <img
          src={avatar}
          alt="Фото профиля"
          class="profile__image profile__image-btn"
          />
        </a>

        <div class="profile__credentials">
          <div class="profile__title-wrapper">
            <h1 class="profile__credentials-title">Жак-Ив Кусто</h1>
            <button class="profile__edit-button hover"
            onClick={handleEditProfileClick}></button>
          </div>
          <p class="profile__credentials-subtitle">Исследователь океана</p>
        </div>
        <button class="profile__btn hover" type="button"
        onClick={handleAddPlaceClick}>
          <img
            src={plus}
            alt="Кнопка плюс"
            class="profile__btn-content"
            // onClick={handleClick}
          />
        </button>
      </section>
      <section class="gallery container"></section>
    </main>
  )
}
export default Main ;
